import React from 'react';
import './Home.css';

function Home() {
    return (
        <>
            <div className='home'>
            <h1>Welcome to Book Tracker</h1>
            <p>Track your reading progress and discover new books.</p>
            </div>
        </>
    );
}

export default Home;
